import Footerr from "../Footer";
import NavBar from "../Navbar";
import { useState, useEffect } from "react";

const Appmnt = () => {
    const [testList, setTestList] = useState([{
        testName: "svsvs", test_id: 56
    }]);

    return ( 
        <div>
            <NavBar></NavBar>

            <div>{ setTestList.map((test)=> {
                return (
                    <div>{test}</div>
                )
            } )}</div>


            <Footerr></Footerr>
        </div>
     );
}
 
export default Appmnt;
